import React,{Component} from 'react';
import './App.css';
import Clarifai from 'clarifai' ;
import Particles from 'react-particles-js';
import Navigation from './Navigation/navigation';
import Logo from './LOGO/Logo';
import Imag from './Image/Image';
import Rank from './rank/Rank' ;
import Facedetect from './Face/facedetection.js';
const app = new Clarifai.App({
  apiKey: 'f656cc73e40844d5a5d984cc88c3d102'
 });
const particlesop = {
  particles: {
    number: {
      value : 75,
      density :{
        enable: true,
        value_area: 800
      }

    } 
  }
}
class App extends Component{
  constructor(){
    super() ;
    this.state = {
      input: '' ,
      imageurl: '' ,
    }
  }
  onInputchange =(event)=>{
    this.setState({input : event.target.value}) ;
  }
  onButtonSubmit = ()=>{
    this.setState({imageurl : this.state.input}) ;
    app.models.predict(
      Clarifai.COLOR_MODEL , 
      "https://tse2.mm.bing.net/th?id=OIP.E4-9d1QwGgcx2DvYQ9esJgHaHa&pid=Api&P=0&w=300&h=300")
    .then(
      function(response) {
        console.log(response) ;
      } ,
      function(err){
        //For an error
      }
    );
  }
  render(){
      return (
    <div className="App">
      <Particles className="part" 
                params={particlesop} />
     <Navigation />
     <Logo />
     <Rank />
     <Imag onInputchange={this.onInputchange} onButtonSubmit={this.onButtonSubmit} />
    <Facedetect imageUrl={this.state.imageurl} /> 
    </div>
  ); }
}

export default App
